  <Card>
    <Card.Content header="Create a new project!" />
    <Card.Content description={description} />
    <Card.Content extra>
      <Card.Meta>Are you a homeowner or contractor?</Card.Meta>
      <div className="ui two buttons">
        <Button basic color="green">
          Contractor
